import React from 'react'
import DownloadHeader from './Download_header';
import Download_Hero from './Download_Hero';
import Masonry_Layout from './Masonry_Layout';


const Download_Page = () => {
    return (
      <>
        <DownloadHeader/>
        <Download_Hero/>
        <Masonry_Layout/>
       
      </>
    )
}

export default Download_Page
